def combination_sum_ii(candidates, target):
    def dfs(start, path, target):
        if target < 0:
            return
        if target == 0:
            result.append(path)
            return
        for i in range(start, len(candidates)):
            if i > start and candidates[i] == candidates[i-1]:
                continue
            dfs(i+1, path + [candidates[i]], target - candidates[i])

    candidates.sort()
    result = []
    dfs(0, [], target)
    return result
